import React from "react";
import "./style.css";

// Depending on the current path, this component sets the "active" class on the appropriate navigation link item
function Navbar() {
  return (
    <div>
    <nav className="navbar navbar-expand-lg" styleClass="envNav">
      <ul style={{listStyleType: "none", textAlign: "center",fontFamily: "Sans",color: "#ffffff"}}>
       <li><a className="navbar-brand" href="/" style={{color: "#ffffff",  fontSize:"45px"}}>
        Employee Directory</a>
      </li>
      <li>
      <span style={{fontSize: "15px"}}>Click on carrots to filter by heading or use the search box to narrow your results.</span>
      </li>
      </ul>
    </nav>

    </div>
  );
}

export default Navbar;
